import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

export default function App() {

    return (
        <Router>
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/chat" element={<About />} />
            </Routes>
        </Router>
    );
}

function Home() {
    return (
        <>
            <h1>Home</h1>
            <button className="chat">New Chat</button>
            <button className="chat">Join Chat</button>
        </>
    );
}

function About() {
    return <h1>About</h1>;
}
